import React from "react";
import PortfolioData from "./PortfolioData";
import PortfolioContent from "./PortfolioContent";
const Portfolio = () => {
  return (
    <div>
      {PortfolioData.map((pData) => (
        <PortfolioContent key={pData.id} pData={pData} />
      ))}
    </div>
  );
};

export default Portfolio;
